// src/imageImports.js
import ironmanMark85 from '../Image/ironman-mark85.jpeg';
import captainAmericaShield from '../Image/captain-america-shield.jpeg';
import spiderManWebSlinger from './Image/spider-man-web-slinger.jpeg';
import thorMjolnir from './Image/thor-mjolnir.jpeg';
// Import gambar lainnya...

export const images = {
  'ironman-mark85': ironmanMark85,
  'captain-america-shield': captainAmericaShield,
  'spider-man-web-slinger': spiderManWebSlinger,
  'thor-mjolnir': thorMjolnir,
  // Tambahkan mapping lainnya...
};
